std::bitset<10005> bs;
std::vector<int> sieve()
{  
    std::vector<int> res;
    bs.set();
    int ub = 10005;
    bs[0]=bs[1]=0;
    for(int i=2;i<=ub;i++){
        if(bs[i]){
            for(int j=i*i;j<=ub;j+=i){
                bs[j]=0;
            }
            res.push_back(i);
        }
    }
    return res;
}

